public class InnerDataSourceRedshiftParametersFactory(Action<Humidifier.QuickSight.DataSourceTypes.RedshiftParameters> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.DataSourceTypes.RedshiftParameters>
{

    internal InnerDataSourceRedshiftIAMParametersFactory IAMParametersFactory { get; set; }

    internal InnerDataSourceIdentityCenterConfigurationFactory IdentityCenterConfigurationFactory { get; set; }

    protected override Humidifier.QuickSight.DataSourceTypes.RedshiftParameters Create()
    {
        var redshiftParametersResult = CreateRedshiftParameters();
        factoryAction?.Invoke(redshiftParametersResult);

        return redshiftParametersResult;
    }

    private Humidifier.QuickSight.DataSourceTypes.RedshiftParameters CreateRedshiftParameters()
    {
        var redshiftParametersResult = new Humidifier.QuickSight.DataSourceTypes.RedshiftParameters();

        return redshiftParametersResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DataSourceTypes.RedshiftParameters result)
    {
        base.CreateChildren(result);

        result.IAMParameters ??= IAMParametersFactory?.Build();
        result.IdentityCenterConfiguration ??= IdentityCenterConfigurationFactory?.Build();
    }

} // End Of Class

